import { Component, OnInit } from '@angular/core';
import { LeaderboardService } from '../leaderboard.service';
import { TopPlayerByGame } from '../types';

@Component({
  selector: 'app-q5',
  templateUrl: './q5.component.html',
  styleUrls: ['./q5.component.css']
})
export class Q5Component implements OnInit{
  TopPlayerByGames: TopPlayerByGame[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getTopPlayer()
      .subscribe(TopPlayerByGames => this.TopPlayerByGames = TopPlayerByGames);
  }
}
